import React from 'react';
import "./Node.css";

function Node(props){
    let extraclassName= props.isEnd? 'node-end': props.isStart? 'node-start': props.isWall?'node-wall':'';
    
    return <div 
        id={`${props.row}-${props.col}`}
        className={`node ${extraclassName}`}
        onClick={() => {if(!props.isEnd && !props.isStart && !props.isWall){
            extraclassName = 'node-wall'; 
        }}}
    />
}

export default Node;
